// ====== IMAGE SELECTOR ======
function getImageSrc(title) {
  const t = (title||"").toLowerCase();
  if (t.includes("jollof"))                                           return IMG_JOLLOF_RICE;
  if (t.includes("fried rice"))                                       return IMG_FRIED_RICE;
  if (t.includes("meat pie")||t.includes("puff")||t.includes("samosa")) return IMG_MEAT_PIE;
  if (t.includes("eba")||t.includes("egusi")||t.includes("okra")||t.includes("pounded")||t.includes("efo")) return IMG_EBA_EGUSI;
  if (t.includes("white rice")||t.includes("beef/gizzard")||t.includes("beef stir")) return IMG_WHITE_RICE_STEW;
  if (t.includes("beans"))                                            return IMG_WHITE_RICE_BEANS;
  if (t.includes("wrap"))                                             return IMG_WRAP;
  if (t.includes("sandwich")||t.includes("sharwarma"))               return IMAGE_LIBRARY.sandwich;
  if (t.includes("cereal"))                                           return IMAGE_LIBRARY.cereal;
  if (t.includes("pancake"))                                          return IMAGE_LIBRARY.pancakes;
  if (t.includes("toast"))                                            return IMG_TOAST;
  if (t.includes("bread & egg")||t.includes("bread/yam"))             return IMG_BREAD_EGG;
  if (t.includes("yam")||t.includes("porridge"))                     return IMAGE_LIBRARY.yam;
  if (t.includes("akara"))                                            return IMAGE_LIBRARY.akara;
  if (t.includes("salad"))                                            return IMAGE_LIBRARY.salad;
  if (t.includes("salmon"))                                           return IMG_SALMON;
  if (t.includes("stir-fry")||t.includes("stir fry"))               return IMG_STIRFRY;
  if (t.includes("tuna"))                                             return IMAGE_LIBRARY.tuna;
  if (t.includes("light snack")||t.includes("veggie bowl")||t==="-") return IMAGE_LIBRARY.lightbowl;
  if (t.includes("pepper soup"))                                      return IMAGE_LIBRARY.souppepper;
  if (t.includes("grilled fish")||t.includes("fish"))                return IMAGE_LIBRARY.fish;
  if (t.includes("pasta")||t.includes("spaghetti"))                  return IMAGE_LIBRARY.pasta;
  if (t.includes("pizza"))                                            return IMAGE_LIBRARY.pizza;
  if (t.includes("grilled chicken"))                                  return IMAGE_LIBRARY.grilled;
  if (t.includes("plantain"))                                         return IMAGE_LIBRARY.plantain;
  return IMAGE_LIBRARY.sandwich;
}

function makeMeal(title, mealType) {
  const empty = (!title || title === "-" || title === "");
  if (empty) {
    return { title:"", cuisine:"", kcalPerServing:0, mealType,
      ingredients:[], kidsMenu:null,
      steps:["No meal planned for this slot."], note:"",
      image: IMAGE_LIBRARY.lightbowl };
  }
  const kcal = KCAL_MAP[title] || 500;
  const t = title.toLowerCase();
  const cuisine =
    (t.includes("jollof")||t.includes("egusi")||t.includes("eba")||t.includes("puff")||
     t.includes("pepper soup")||t.includes("okra")||t.includes("pounded")||t.includes("efo")||
     t.includes("akara")||t.includes("sharwarma")||t.includes("porridge")) ? "Nigerian" :
    (t.includes("pasta")||t.includes("pizza")||t.includes("spaghetti")) ? "Italian" :
    (t.includes("wrap")) ? "Fusion" : "Family";
  return {
    title, cuisine, kcalPerServing: kcal, mealType,
    ingredients: getIngredients(title),
    kidsMenu: mealType === "lunch" ? (KIDS_MENU_MAP[title] || null) : null,
    steps: [
      "Prep all ingredients and gather your seasonings.",
      "Cook following your preferred method for this dish.",
      "Season to taste  add extra spice to adult portions if desired."
    ],
    note: "", image: getImageSrc(title)
  };
}

